import React from "react";
import { DashboardHeader } from "../components";

const NewRequest = () => {
  return (
    <>
      <DashboardHeader />
      <div>
        <Pagination
          activePage={this.state.activePage}
          itemsCountPerPage={10}
          totalItemsCount={450}
          pageRangeDisplayed={5}
          onChange={this.handlePageChange.bind(this)}
        />
      </div>
    </>
  );
};

export default NewRequest;
